The context type is a feature in Juniper that lets field resolvers access global data, most commonly database connections or authentication information. The context is usually created from a context factory . How this is defined is specific to the framework integration you're using, so check out the documentation for either the Iron or Rocket integration. In this chapter, we'll show you how to define a context type and use it in field resolvers. Let's say that we have a simple user database in a HashMap: # #![allow(dead_code)]
# use std::collections::HashMap; struct Database { users: HashMap<i32, User>,
} struct User { id: i32, name: String, friend_ids: Vec<i32>,
} # fn main() { } We would like a friends field on User that returns a list of User objects. In order to write such a field though, the database must be queried. To solve this, we mark the Database as a valid context type and assign it to the user object. To gain access to the context, we need to specify an argument with the same type as the specified Context for the type: # use std::collections::HashMap;
extern crate juniper; // This struct represents our context.
struct Database { users: HashMap<i32, User>,
} // Mark the Database as a valid context type for Juniper
impl juniper::Context for Database {} struct User { id: i32, name: String, friend_ids: Vec<i32>,
} // Assign Database as the context type for User
#[juniper::object( Context = Database,
)]
impl User { // 3. Inject the context by specifying an argument // with the context type. // Note: // - the type must be a reference // - the name of the argument SHOULD be context fn friends(&self, context: &Database) -> Vec<&User> { // 5. Use the database to lookup users self.friend_ids.iter() .map(|id| context.users.get(id).expect("Could not find user with ID")) .collect() } fn name(&self) -> &str { self.name.as_str() } fn id(&self) -> i32 { self.id }
} # fn main() { } You only get an immutable reference to the context, so if you want to affect change to the execution, you'll need to use interior mutability using e.g. RwLock or RefCell.

